      await storeValue("clientCode", getAllClients.data.value[0].cr2b8_codeclient, false);
    }
  }).then(() => {
    getOneClient.run({
      clientCode: appsmith.store.clientCode
    });
  }).then(() => {
    GetOptions.run({
      options: "cr9c2_type_de_contacts"
    });
  });
}

